// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract BookFactory
{
    uint bookID;
    address[] bookContractAddresses;

    function createBookContract() external
    {
        bookID++;

        // pointer to book contract
        Book book = new Book(bookID);

        // cast book pointer to address
        bookContractAddresses.push(address(book));
    }
}

contract Book
{
    uint public bookID;
    address admin;

    constructor(uint _bookID)
    {
        bookID = _bookID;

        // set admin to creator of smart contract (so the seller)
        admin = msg.sender;
    }
}

